import React from 'react'

class Columns extends React.Component {
  constructor (props) {
    super(props)
    this.state = {
      'showLoading': true,
      'showError': false
    }
    this.elements = []
  }
  componentDidMount () {
    fetch(`http://http://46.188.118.134:8082/navigations?type=${this.props.type}`)
      .then(response => response.json())
      .then(response => {
        console.log('aasdsdasdsadasds')
        response
          .pop()
          .articles
          .sort((a, b) => a.createdAt < b.createdAt ? 1 : -1)
          .forEach(article => {
            console.log("sddsdsdsd")
            if (article.is_active === true) {
              this.elements.push(

                <div className='column is-3'>
                  <div class='container'>
                    <div class='columns'>
                      <div class='column is-3 is-offset-2'>
                        <ul>
                          <li><a href='#'>{article.name_ru}</a></li>
                        </ul>
                      </div>
                    </div>
                  </div>
                </div>
              )
            }
          })
        this.setState({
          'showLoading': false,
          'showError': false
        })
      })
      .catch(error => {
        console.error(error)
        this.setState({
          'showLoading': false,
          'showError': true
        })
      })
  }
  render () {
    return (
      <footer class='footer'>



              {this.elements}




      </footer>
    )
  }
}
export default Columns
